  \"Efficient Tm-Fiber-Pumped Ho:YLF Laser System for Coherent LIDAR Applications
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
