  \"efficient-tm-fiber-pumped-ho-ylf-laser-system-for-coherent-lidar-applications-project-22137\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of the proposed Phase
  II program is to develop and deliver a ruggedized, compact single-frequency 2050-nm-laser
  system suitable for coherent LIDAR applications. Such a system uses the latest Tm:silica
  heavily-doped fiber technology to provide as much as 3X efficiency improvement over
  existing systems. An all-amplifier technology provides flexibility and stability
  in the generation of coherent lidar waveforms. The hybrid fiber/bulk amplifier scheme
  allows to combine the advantage of high small-signal gain attainable in a fiber
  amplifier with the advantages of a bulk crystal amplifier such as high storage efficiency,
  immunity to various non-linear processes and damage-free operation for pulse generation.rnrn\",\n\t\"license_title\":
